  "text" : "\uC0AC\uB78C\uB9C8\uB2E4 \uC131\uCDE8\uD558\uB294 \uC18D\uB3C4\uC640 \uBC30\uC6B0\uB294 \uBC29\uC2DD\uC774 \uB2E4 \uB2E4\uB978\uB370, \uAD6D\uAC00\uAC00 \uC758\uBB34\uAD50\uC721\uC774\uB77C\uB294 \uC774\uB984\uC73C\uB85C \uC911\uD559\uAD50\uAE4C\uC9C0 \uAC00\uB974\uCE5C\uB2E4\uBA74 \uCD5C\uC18C\uD55C \uB2A5\uB825\uC744 \uAC16\uCD94\uAC8C\uB054 \uC774\uB044\uB294 \uAC8C \uCC45\uBB34\uB77C\uACE0 \uC0DD\uAC01\uD55C\uB2E4. \uD604\uC7AC\uC758 \uAD50\uC721\uBC29\uC2DD\uC73C\uB85C \uBABB \uB530\uB77C\uC624\uB294 \uD559\uC0DD\uB4E4\uC744 \uBB34\uC2DC\uD558\uB294\uAC8C \uC544\uB2C8\uB77C \uADF8\uB4E4\uC744 \uB530\uB77C\uC624\uAC8C\uB054 \uD601\uC2E0\uD574\uC57C \uD55C\uB2E4.",
