  "text" : "\uB300\uD559\uC774 \uB300\uD559\uAC19\uC9C0\uC54A\uACE0 \uD559\uB825\uC740 \uC62C\uB77C\uAC00\uC9C0\uB9CC \uC218\uD559\uB2A5\uB825\uC774 \uB5A8\uC5B4\uC838 \uC608\uC804\uC758 \uACE0\uB4F1\uD559\uC0DD\uB9CC \uBABB\uD558\uB2E4\uB294 \uB9D0\uB3C4 \uC790\uC8FC \uB4E4\uC5C8\uB2E4. \uADF8\uAC74 \uD559\uC0DD \uD0D3\uC774 \uC544\uB2C8\uB77C \uAE30\uCD08\uBB38\uD574\uB825\uACFC STEM \uB2A5\uB825\uC744 \uC2DC\uBBFC\uC73C\uB85C \uC0AC\uB294\uB370 \uD544\uC694\uD55C \uB9CC\uD07C \uB04C\uC5B4\uC62C\uB9AC\uC9C0 \uBABB\uD558\uB294\uB370\uB3C4 \uC878\uC5C5\uC2DC\uD0A4\uB294 \uAC8C \uBB38\uC81C\uB2E4. \uB098\uB294 \uC720\uAE09\uC81C\uB97C \uC9C0\uC9C0\uD55C\uB2E4.",
